    "id00261_app:vote:sustitucion:body": "<p>A l'efecte del que disposen els articles 523 i 526 de la Llei de Societats de Capital (LSC), s'informa que el President del Consell, així com qualsevol altre membre del Consell d'Administració, pot trobar-se en conflicte d'interessos. Si el representat no hagués impartit instruccions de vot precises, la representació, llevat d'indicació expressa en contra a continuació, s'entendrà conferida, solidària i successivament, al secretari del Consell d'Administració o el vicesecretari del Consell d'Administració. Marqueu la casella NO següent només si no autoritza la substitució (en aquest cas s'entendrà que l'accionista instrueix al representant perquè s'abstingui):</p>",
