    "id00275_home:app:pendiente:text": "Sr. / Sra. Accionista, <br/><br/>L'informem que la seva alta al sistema està pendent de ser validada.<br/>Tan aviat hagi estat revisada i confirmada, rebrà un email indicant-li que ja podrà accedir a la plataforma.<br/><br/>Cordialment, <br/><br/>L'Administrador",
