    "id00282_app:foro:dashboard:title": "Benvingut/da, ",
    "id00283_app:foro:dashboard:subtitle": "al Forum Electrònic de %%empresa%%",
    "id00284_app:foro:dashboard:body": "<p>Seguint les disposicions de la \"Llei de societats de capital\", aquesta plataforma ha estat disposada perquè pugui exercir els seus drets de participació.</p><p>Com es defineix en les diferents opcions, podrà:</p><ol><li>Presentar les seves propostes</li><li>Presentar les seves iniciatives</li><li>Presentar les seves ofertes o peticions de representació, o </li><li>Adherir-se a les presentades per altres accionistes </li></ol><p>Els menús que es presenten a la banda esquerra de la pantalla, estan agrupats de manera que pugui accedir a les accions realitzades per altres accionistes (públiques)< i class=\"fa fa-users\"></i>, a les quals vostè hagi creat (personals) <i class=\"fa fa-user\"></i> i finalment la que li permetrà crear de forma explícita <i class=\"fa fa-pencil-square-o\"></i>.</p><p>Aquest és un fòrum moderat, el que significa que les opcions dutes a terme pels accionistes, seran revisades per l'administrador de la plataforma, d'acord amb el que estableix el reglament d'aquest. Dins de l'horari comprès entre les 09:00h i les 18:00h de dilluns a dijous i els divendres de 09:00h a 15:00h</p>",
    "id00285_app:foro:info:modal:title": "Informació",
    "id00286_app:foro:offer:info:modal:body": "Contingut",
    "id00287_app:foro:request:info:modal:body": "Contingut",
