    "id00291_app:voto:welcome:title": "Benvingut/da, ",
    "id00292_app:voto:welcome:subtitle": "al Vot / Delegació Electrònica de %%empresa%%",
    "id00293_app:voto:welcome:body": "<p>Seguint les disposicions de la \"Llei de societats de capital\", aquesta plataforma ha estat disposada perquè pugui exercir els seus drets de participació.</p><p>Des de la mateixa podrà Delegar les seves accions o Votar electrònicament, segons es mostren en les opcions de l'assistent.</p><p>les opcions que es presenten a la banda esquerra de la pantalla, corresponen al punt de l'assistent en el qual vostè. es troba.</p><p>A la part inferior dreta de la pantalla es mostra els botons de navegació.</p><p>A través d'aquest assistent podrà delegar la seva representació o votar en la Junta d'Accionistes. En l'última pantalla se li demanarà confirmi el procés, el que generarà el registre a la nostra base de dades i vostè rebrà un correu electrònic de confirmació, on podrà veure les accions que hagi enregistrat.</p><p>Finalment, ha de tenir en compte que la seva assistència física a la Junta d'Accionistes, o l'alienació de les seves accions que tingués coneixement la Societat abans de la celebració de la Junta en primera convocatòria, anul · laran el vot o delegació que hagi pogut realitzar a través d'Internet (o mitjançant qualsevol altre mitjà de comunicació a distància).</p><p>Per iniciar el procés, feu clic al botó \"Següent\".</p>",
    "id00294_app:foro:adhesion:disabled": "No és possible adherir-se a una %%item%% si ja hi ha una pròpia o una adhesió a aquestes.",
    "id00295_app:foro:adhesion:offer": "oferta",
    "id00296_app:foro:adhesion:request": "petició",
    "id00297_home:app:retornar:title": "Retornar accionistes",
    "id00298_home:app:retornar:message": "La documentació i/o dades no han estat completats.<br/>Si us plau, reviseu-los conforme al que l'hagi indicat l'administrador i torneu a enviar el registre a la plataforma perquè pugui ser donat d'alta a la mateixa.",
    "id00299_app:representation:atencion": "Atenció",
    "id00300_app:voto:shares:body": "<p>Si us plau, introduïu el nombre d'accions de la Societat de les que vostè és titular, si aquest és diferent del que va indicar quan va realitzar el registre en la Plataforma. Aquesta dada serà verificat posteriorment contrastant amb el que figuri en el \"Llibre d'Accionistes\", sent aquest últim el que serà considerat com a vàlid per la Societat de conformitat amb la normativa vigent.</p>",
