    "id00310_app:voto:sustitution": "Substitució",
    "id00311_app:voto:delegation:body": "<h3>A continuació s'ha de seleccionar en qui desitja delegar</h3><p>s'entén que vostè autoritza a la persona en la qual vostè delegui la seva representació a que voti en aquells assumptes que, encara no figurant en l'ordre del dia, puguin ser sotmesos a la votació a la Junta General d'Accionistes. En aquest cas el representant exercirà el vot en el sentit que consideri més favorable per als interessos de l'accionista representat, llevat que vostè ens indiqui el contrari en l'apartat \"Contacte\", la icona amb forma de sobre situada a la part superior d'aquesta Plataforma, indicant el seu nom i adreça de correu electrònic</p>",
