    "id00321_app:voto:instructions:body": "<h3>Voleu indicar instruccions de vot?</h3><p>En el supòsit de delegació de la representació en el President del Consell d'Administració, així com en altres consellers als quals sigui aplicable el règim de sol·licituds públiques de representació, si no indica instruccions expresses de vot, s'entendrà que aquest votarà a favor de les propostes d'acords formulades pel Consell d'Administració.</p>",
    "id00322_app:voto:instructions:yes": "Sí",
    "id00323_app:voto:instructions:no": "No",
    "id00324_app:voto:voto": "Votació",
    "id00325_app:voto:body:vote": "<p>A continuació indiqui les seves instruccions de vot.</p><p>Podeu fer-ho globalment des de les opcions que apareixen després d'aquests comentaris o individualment a cada punt.</p><p>En el cas que vostè no indiqui instruccions de vot en relació amb un o diversos punts de l'ordre del dia, s'entendrà que, per a aquests punts de l'ordre del dia, vostè vota a favor de les propostes formulades pel Consell d'Administració.</p><p>en el supòsit de delegació de la representació en el President del Consell d'Administració, així com en altres consellers als quals sigui aplicable el règim de sol·licituds públiques de representació, si no indica instruccions expresses de vot, s'entendrà que aquest votarà a favor de les propostes d'acords formulats pel Consell d'Administració.</p>",
