    "id00375_app:derecho:dashboard:body": "<p>Seguint les disposicions de la \"Llei de societats de capital\", aquesta plataforma ha estat disposada perquè pugui exercir els seus drets de participació.</p><p>Com es defineix en les diferents opcions, podrà:</p><ol><li>Crear Solicituds</li><li>Veure Solicituds públiques</li><li>Veure comunicats emèsos per la societat</li></ol><p>Els menús que es presenten a la banda esquerra de la pantalla, estan agrupats de manera que pugui accedir a les accions realitzades per altres accionistes (públiques)< i class=\"fa fa-users\"></i>, a les quals vostè hagi creat (personals) <i class=\"fa fa-user\"></i> i finalment la que li permetrà crear de forma explícita <i class=\"fa fa-pencil-square-o\"></i>.</p><p>Aquest és una plataforma moderada, el que significa que les opcions dutes a terme pels accionistes, seran revisades per l'administrador de la plataforma, d'acord amb el que estableix el reglament d'aquest. Dins de l'horari comprès entre les 09:00h i les 18:00h de dilluns a dijous i els divendres de 09:00h a 15:00h</p>",
