    "id00443_app:av:body:vote": "<p>A continuació indiqui les seves instruccions de vot.</p><p>Pot fer-ho globalment mitjançant les opcions que apareixen després d'aquestos comentaris o fer-ho individualment a cada punt. </p><p>En el cas de que vosté indiqui instruccions de vot en relació a un o diversos punts de l'Ordre del Dia, es donara per suposat que, per aquestos punts de l'Ordre del Dia, vosté vota a favor de lres propostes formulades per el Consell Administratiu.</p>",
