    "id00447_app:av:welcome:body": "<p>Seguint les disposicions de la \"Llei de Societats de Capital\", aquesta plataforma ha estat proporcionada per a que pugui exercicr el seu dret de participació.</p><p>Des de la mateixa podrà voar electrònicament, segons es mostren les opcions del asistent.</p><p>Las opcions que es presenten en el costat esquerre de la pantalla, corresponen al punt de l'assistent en el qual vostè. es troba. </ p> <p> A la part inferior dreta de la pantalla es mostra els botons de navegació. </ p> <p> A través d'aquest assistent podrà votar a la Junta d'Accionistes. En l'última pantalla se li demanarà que confirmi el procés, el que generarà el registre a la base de dades i vostè rebrà un correu electrònic de confirmació, on podrà veure les accions que s'hagi registrat. </ P> <p> Per a iniciar el procés, feu clic al botó \"Següent\". </p> ",
