    "id00498_app:av:new-leave": "Registro de salida",
    "id00499_app:av:leave:body": "<p>Siguiendo las disposiciones de la \"Ley de Sociedades de Capital\", esta plataforma ha sido dispuesta para que pueda ejercer sus derechos de participación.</p><p>Desde la misma podrá Votar electrónicamente, según se muestran en las opciones del asistente.</p><p>Las opciones que se presentan en el lado izquierdo de la pantalla, corresponden al punto del asistente en el que vd. se encuentra.</p><p>En la parte inferior derecha de la pantalla se muestra los botones de navegación.</p><p>A través de este asistente podrá votar en la Junta de Accionistas. En la última pantalla se le pedirá que confirme el proceso, el que generará el registro en nuestra base de datos y usted recibirá un correo electrónico de confirmación, donde podrá ver las acciones que haya registrado.</p><p>Para iniciar el proceso, haga clic en el botón \"Siguiente\".</p>",
    "id00500_app:av:new-leave:confirm":"Guardar",
    "id00501_app:av:leave:privacy-policy":"Acepto que abandono",
    "id00502_app:logger:new-leave-success": "Registro de salida correcto",
    "id00503_app:av:dashboard:title": "Instruccions, ",
    "id00504_app:av:dashboard:subtitle": "d'ús per a la votació electrònica de %%empresa%%.",
    "id00505_app:av:dashboard:body": "<p>Seguint les disposicions de la \"Llei de Societats de Capital\", aquesta plataforma ha estat proporcionada per a que pugui exercicr el seu dret de participació.</p><p>Des de la mateixa podrà voar electrònicament, segons es mostren les opcions del asistent.</p><p>Las opcions que es presenten en el costat esquerre de la pantalla, corresponen al punt de l'assistent en el qual vostè. es troba. </ p> <p> A la part inferior dreta de la pantalla es mostra els botons de navegació. </ p> <p> A través d'aquest assistent podrà votar a la Junta d'Accionistes. En l'última pantalla se li demanarà que confirmi el procés, el que generarà el registre a la base de dades i vostè rebrà un correu electrònic de confirmació, on podrà veure les accions que s'hagi registrat. </ P> <p> Per a iniciar el procés, feu clic al botó \"Següent\". </p> ",
